.signup-container {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-color: #f8f8f8;
}

.signup-box {
  background-color: white;
  padding: 2.5rem 2rem;
  border-radius: 12px;
  box-shadow: 0 0 12px rgba(0, 0, 0, 0.08);
  width: 100%;
  max-width: 400px;
  text-align: center;
}

.signup-title {
  font-size: 24px;
  font-weight: 600;
  color: #a24310;
  margin-bottom: 8px;
}

.signup-subtitle {
  color: #555;
  font-size: 15px;
  margin-bottom: 24px;
}

.signup-label {
  font-weight: 500;
  display: block;
  text-align: left;
  margin-bottom: 6px;
  color: #222;
}

.input-group {
  display: flex;
  align-items: center;
  background-color: #f2f2f2;
  border-radius: 6px;
  padding: 0.5rem 0.75rem;
  margin-bottom: 20px;
}

.phone-icon {
  margin-right: 10px;
  font-size: 18px;
}

.signup-input {
  border: none;
  outline: none;
  background: transparent;
  flex: 1;
  font-size: 15px;
}

.signup-button {
  background-color: #c1440e;
  color: white;
  padding: 0.7rem;
  width: 100%;
  border: none;
  border-radius: 6px;
  font-size: 15px;
  cursor: pointer;
  transition: 0.3s ease;
}

.signup-button:hover {
  background-color: #a2380c;
}

.signup-login {
  margin-top: 16px;
  font-size: 14px;
